import React from 'react';
import Logo from './Logo'; // Import the Logo component
import MenuItem from './MenuItem'; // Import the MenuItem component
import Footer from './Footer'; // Import the Footer component

const Navigation = () => {
  return (
    <div className="menu-sidebar">
      <Logo /> {/* Use Logo component */}
      <ul className="menu">
        <MenuItem to="/" icon="fas fa-home" label="Home" />
        <MenuItem to="/profile" iconClass="fas fa-users" label="Profile" />
        <MenuItem to="/payroll" iconClass="fas fa-money-check" label="Payroll" />
        <MenuItem to="/dataentry" iconClass="fas fa-database" label="Data Entry" />
        <MenuItem to="/settings" iconClass="fas fa-cog" label="Settings" />
        <MenuItem to="/logout" iconClass="fas fa-sign-out-alt" label="Logout" />
      </ul>
      <div className='menu-footer'>
        <Footer />
      </div>
    </div>
  );
};

export default Navigation;
